import React from 'react';
import NavBar from './components/NavBar';
import Introduction from './components/Introduction';
import Skills from './components/Skills';

function App() {
  return (
    <div className="App">
      <NavBar />
      <Introduction />
      <Skills />
    </div>
  );
}

export default App;
